// create basis class
mpFlow::FEM::basis::Quadratic::Quadratic(
    Eigen::ArrayXXf nodes,
    dtype::index one)
    : mpFlow::FEM::basis::Basis<pointsPerEdge, pointsPerElement>(nodes) {
    // check one
    if (one >= pointsPerElement) {
        throw std::invalid_argument(
            "mpFlow::FEM::basis::Quadratic::Quadratic: one >= pointsPerElement");
    }

    // calc coefficients with gauss
    Eigen::ArrayXXf A = Eigen::ArrayXXf::Zero(pointsPerElement, pointsPerElement);
    Eigen::ArrayXf b = Eigen::ArrayXf::Zero(pointsPerElement);
    b(one) = 1.0;

    // fill coefficients
    for (dtype::index node = 0; node < pointsPerElement; ++node) {
        A(node, 0) = (1.0);
        A(node, 1) = ((1.0)*(this->nodes(node, 0)));
        A(node, 2) = ((1.0)*(this->nodes(node, 1)));
        A(node, 3) = ((1.0)*((this->nodes(node, 0))*(this->nodes(node, 0))));
        A(node, 4) = ((1.0)*((this->nodes(node, 1))*(this->nodes(node, 1))));
        A(node, 5) = (((1.0)*(this->nodes(node, 0)))*(this->nodes(node, 1)));
    }

    // calc coefficients
    this->coefficients = math::gaussElemination(A, b);
}

